import React, { useEffect, useState } from "react";
import { logout } from "../api";
import { Link, useNavigate } from "react-router-dom";

export default function Profile() {
  const [profile, setProfile] = useState({
    email: "",
    domain: [],
    role: [],
    experience: "",
    visa: "",
    locations: [],
    work_mode: []
  });

  const navigate = useNavigate();

  useEffect(() => {
    const load = async () => {
      const token = localStorage.getItem("access_token");
      if (!token) return navigate("/login");

      const res = await fetch("http://localhost:8000/api/profile", {
        headers: { Authorization: `Bearer ${token}` },
      });

      if (res.status === 401) return navigate("/login");

      const data = await res.json();
      setProfile(data);
    };

    load();
  }, []);

  const handleChange = (field, value) => {
    setProfile({ ...profile, [field]: value });
  };

  const saveProfile = async () => {
    const token = localStorage.getItem("access_token");

    const res = await fetch("http://localhost:8000/api/profile/update", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Authorization: `Bearer ${token}`
      },
      body: JSON.stringify(profile),
    });

    if (res.ok) alert("Saved!");
    else alert("Error saving profile");
  };

  function handleLogout() {
    logout();
    navigate("/login");
  }

  return (
    <div style={{ padding: 20 }}>
      <header style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <h2>Profile</h2>
        <nav>
          <Link to="/dashboard" style={{ marginRight: 12 }}>Dashboard</Link>
          <Link to="/profile" style={{ marginRight: 12 }}>Profile</Link>
          <button onClick={handleLogout}>Logout</button>
        </nav>
      </header>

      <section style={{ marginTop: 20 }}>
        <h3>Your Preferences</h3>

        {/* EMAIL */}
        <label>Email</label>
        <input
          type="text"
          value={profile.email}
          readOnly
          style={{ width: "100%", marginBottom: 10 }}
        />

        {/* EXPERIENCE */}
        <label>Experience (Years)</label>
        <input
          type="number"
          value={profile.experience || ""}
          onChange={(e) => handleChange("experience", Number(e.target.value))}
          style={{ width: "100%", marginBottom: 10 }}
        />

        {/* VISA */}
        <label>Visa Sponsorship</label>
        <select
          value={profile.visa || ""}
          onChange={(e) => handleChange("visa", e.target.value)}
          style={{ width: "100%", marginBottom: 10 }}
        >
          <option value="">Select</option>
          <option value="yes">Needs Sponsorship</option>
          <option value="no">No Sponsorship Needed</option>
        </select>

        {/* DOMAINS */}
        <label>Domains (comma-separated)</label>
        <input
          type="text"
          value={profile.domain.join(", ")}
          onChange={(e) => handleChange("domain", e.target.value.split(",").map(s => s.trim()))}
          style={{ width: "100%", marginBottom: 10 }}
        />

        {/* ROLES */}
        <label>Roles (comma-separated)</label>
        <input
          type="text"
          value={profile.role.join(", ")}
          onChange={(e) => handleChange("role", e.target.value.split(",").map(s => s.trim()))}
          style={{ width: "100%", marginBottom: 10 }}
        />

        {/* LOCATIONS */}
        <label>Preferred Locations (comma-separated)</label>
        <input
          type="text"
          value={profile.locations.join(", ")}
          onChange={(e) => handleChange("locations", e.target.value.split(",").map(s => s.trim()))}
          style={{ width: "100%", marginBottom: 10 }}
        />

        {/* WORK MODE */}
        <label>Work Mode (comma-separated â€” remote, hybrid, onsite)</label>
        <input
          type="text"
          value={profile.work_mode.join(", ")}
          onChange={(e) => handleChange("work_mode", e.target.value.split(",").map(s => s.trim()))}
          style={{ width: "100%", marginBottom: 10 }}
        />

        <button onClick={saveProfile}>Save Preferences</button>
      </section>
    </div>
  );
}
